import React from 'react';
import logo from './logo.svg';
import './App.css';

import { BrowserRouter, Switch, Route } from 'react-router-dom';

import LoginPage from './pages/login-page';

function App() {
  return (
    <BrowserRouter>
    <Switch>
      <Route  path="/" element={<LoginPage></LoginPage>} />

    </Switch>
  </BrowserRouter>
  );
}

export default App;
